import React from 'react';
import Navbar from './components/Navbar';
import { css } from '@emotion/react';

function App() {
  const appStyles = css`
    background-color: white;
    height: 100vh;
    overscroll-behavior: none;
    /* Additional styles to extend background into notch area */
    padding-top: 20px; /* Adjust this padding to match the height of the notch area */
    padding-bottom: 20px; /* Adjust this padding to match the height of the bottom safe area */
    position: relative;

    @media (orientation: landscape) {
      padding-top: 10px; /* Adjust this padding for landscape mode */
      padding-bottom: 10px; /* Adjust this padding for landscape mode */
    }
  `;

  return (
    <div css={appStyles}>
      <Navbar />

    </div>
  );
}

export default App;
